package main

import (
	"math"
)

func MaxFill(grid [][]int, capacity int) int {
	totalLowerings := 0

	// For each well (row)
	for _, well := range grid {
		// Count total water units in this well
		waterUnits := 0
		for _, cell := range well {
			waterUnits += cell
		}

		// Calculate number of times we need to lower the bucket
		// This is ceiling(waterUnits / capacity)
		if waterUnits > 0 {
			lowerings := int(math.Ceil(float64(waterUnits) / float64(capacity)))
			totalLowerings += lowerings
		}
	}

	return totalLowerings
}
